INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 1, "", 190804, 1, 60000, 0, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 2, "", 0, 0, 60000, 0, 1, "", 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 3, "", 0, 0, 60000, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 4, "", 0, 0, 60000, 0, 1, "", 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 5, "", 0, 0, 60000, 0, 2, "", 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 6, "", 0, 0, 60000, 0, 2, "", 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 7, "", 0, 0, 60000, 0, 2, "", 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 8, "", 0, 0, 60000, 0, 3, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 9, "", 0, 0, 60000, 0, 3, "", 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 10, "", 0, 0, 60000, 0, 3, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 11, "", 0, 0, 60000, 0, 3, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 12, "", 0, 0, 60000, 0, 3, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 13, "", 0, 0, 60000, 0, 4, "", 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 14, "", 0, 0, 60000, 0, 4, "", 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 15, "", 0, 0, 60000, 0, 4, "", 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 16, "", 0, 0, 60000, 0, 4, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 17, "", 0, 0, 60000, 0, 4, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 18, "", 190804, 2, 60000, 0, 0, "カリン", 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 19, "", 190804, 3, 60000, 7, 0, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 20, "", 101201, 1, 80001, 1, 0, "ハツネ", 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 21, "", 101201, 2, 80001, 1, 0, "ハツネ", 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 22, "", 103801, 1, 80001, 1, 0, "シオリ", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 23, "", 103801, 2, 80001, 1, 0, "シオリ", 1, "来年も、\n一緒にいられたら…\nうれしいな");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 24, "", 103601, 1, 80001, 2, 0, "キョウカ", 0, "あなたと一緒にいるようになって、\nもう1年ですか…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 25, "", 103601, 2, 80001, 2, 0, "キョウカ", 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 26, "", 102001, 1, 80001, 2, 0, "ミミ", 1, "おにいちゃんとあってから、\n1年たったよ～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 27, "", 102001, 2, 80001, 2, 0, "ミミ", 1, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 28, "", 100401, 1, 80001, 2, 0, "ミソギ", 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 29, "", 100401, 2, 80001, 2, 0, "ミソギ", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 30, "", 101001, 1, 80001, 3, 0, "マホ", 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 31, "", 101001, 2, 80001, 3, 0, "マホ", 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 32, "", 104401, 1, 80001, 3, 0, "イリヤ", 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 33, "", 104401, 2, 80001, 3, 0, "イリヤ", 1, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 34, "", 101701, 1, 80001, 3, 0, "カオリ", 2, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 35, "", 101701, 2, 80001, 3, 0, "カオリ", 2, "これからも、どうぞよろしく\nお願いするさ～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 36, "", 102801, 1, 80001, 4, 0, "サレン", 0, "あんたと出会ってからもうそんなに\nたつのね～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 37, "", 102801, 2, 80001, 4, 0, "サレン", 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 38, "", 102501, 1, 80001, 4, 0, "スズメ", 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 39, "", 102501, 2, 80001, 4, 0, "スズメ", 1, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 40, "", 104601, 1, 80001, 5, 0, "タマキ", 0, "振り返れば、今までいろんなことが\nあったにゃあ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 41, "", 104601, 2, 80001, 5, 0, "タマキ", 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 42, "", 104801, 1, 80001, 5, 0, "ミフユ", 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 43, "", 104801, 2, 80001, 5, 0, "ミフユ", 1, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 44, "", 103201, 1, 80001, 6, 0, "アキノ", 0, "あなたさまと出会ってもう1年…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 45, "", 103201, 2, 80001, 6, 0, "アキノ", 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 46, "", 103401, 1, 80001, 6, 0, "ユカリ", 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 47, "", 103401, 2, 80001, 6, 0, "ユカリ", 1, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 48, "", 107101, 1, 80001, 7, 0, "クリスティーナ", 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 49, "", 107101, 2, 80001, 7, 0, "クリスティーナ", 0, "ともかくこれからも\n愉しませてくれよ☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 50, "", 104701, 1, 80001, 7, 0, "ジュン", 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 51, "", 104701, 2, 80001, 7, 0, "ジュン", 1, "見えないから分からないって？\nそれもそうだな…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 52, "", 103701, 1, 80001, 8, 0, "トモ", 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 53, "", 103701, 2, 80001, 8, 0, "トモ", 0, "これからもよろしくね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 54, "", 100501, 1, 80001, 8, 0, "マツリ", 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 55, "", 100501, 2, 80001, 8, 0, "マツリ", 1, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 56, "", 100701, 1, 80001, 9, 0, "ミヤコ", 0, "オマエと会って1年なの！\n全然成仏もできなかったし、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 57, "", 100701, 2, 80001, 9, 0, "ミヤコ", 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 58, "", 103101, 1, 80001, 9, 0, "シノブ", 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 59, "", 103101, 2, 80001, 9, 0, "シノブ", 1, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 60, "", 100901, 1, 80001, 10, 0, "アンナ", 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 61, "", 100901, 2, 80001, 10, 0, "アンナ", 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 62, "", 101301, 1, 80001, 10, 0, "ナナカ", 1, "君と出会ってもう1年だって！\n早いねー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 63, "", 101301, 2, 80001, 10, 0, "ナナカ", 1, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 64, "", 105101, 1, 80001, 11, 0, "ミツキ", 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 65, "", 105101, 2, 80001, 11, 0, "ミツキ", 0, "これからも、いろんなところを\n調べさせてね？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 66, "", 105601, 1, 80001, 11, 0, "ルカ", 1, "お前さんと出会ってもう1年か\n助太刀するつもりが");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 67, "", 105601, 2, 80001, 11, 0, "ルカ", 1, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 68, "", 102701, 1, 80001, 11, 0, "エリコ", 2, "早いものですわね、あなた様と\nお会いして、もう1年…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 69, "", 102701, 2, 80001, 11, 0, "エリコ", 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 70, "", 102301, 1, 80001, 12, 0, "アヤネ", 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 71, "", 102301, 2, 80001, 12, 0, "アヤネ", 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 72, "", 104201, 1, 80001, 12, 0, "チカ", 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 73, "", 104201, 2, 80001, 12, 0, "チカ", 1, "私のことを見守ってください\nできることなら、ずっと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 74, "", 102101, 1, 80001, 12, 0, "クルミ", 2, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 75, "", 102101, 2, 80001, 12, 0, "クルミ", 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 76, "", 104901, 1, 80001, 13, 0, "シズル", 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 77, "", 104901, 2, 80001, 13, 0, "シズル", 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 78, "", 101101, 1, 80001, 13, 0, "リノ", 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 79, "", 101101, 2, 80001, 13, 0, "リノ", 1, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 80, "", 100201, 1, 80001, 14, 0, "ユイ", 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 81, "", 100201, 2, 80001, 14, 0, "ユイ", 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 82, "", 100101, 1, 80001, 14, 0, "ヒヨリ", 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 83, "", 100101, 2, 80001, 14, 0, "ヒヨリ", 1, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 84, "", 100301, 1, 80001, 14, 0, "レイ", 2, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 85, "", 100301, 2, 80001, 14, 0, "レイ", 2, "キミに背中を預けられる日が、\n早くきますように");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 86, "", 105801, 1, 80001, 15, 0, "ペコリーヌ", 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 87, "", 105801, 2, 80001, 15, 0, "ペコリーヌ", 0, "これからもずっと、覚えていて\nくださいね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 88, "", 105901, 1, 80001, 15, 0, "コッコロ", 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 89, "", 105901, 2, 80001, 15, 0, "コッコロ", 1, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 90, "", 106001, 1, 80001, 15, 0, "キャル", 2, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 91, "", 106001, 2, 80001, 15, 0, "キャル", 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 92, "", 112101, 1, 60001, 0, 0, "スズメ", 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 93, "", 0, 0, 60001, 0, 1, "", 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 94, "", 0, 0, 60001, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 95, "", 0, 0, 60001, 0, 1, "", 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 96, "", 0, 0, 60001, 0, 1, "", 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 97, "", 0, 0, 60001, 0, 1, "", 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 98, "", 0, 0, 60001, 0, 2, "", 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 99, "", 0, 0, 60001, 0, 2, "", 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 100, "", 0, 0, 60001, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 101, "", 0, 0, 60001, 0, 2, "", 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 102, "", 0, 0, 60001, 0, 2, "", 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 103, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 104, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 105, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 106, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 107, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 108, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 109, "", 0, 0, 60001, 0, 3, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 110, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 111, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 112, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 113, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 114, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 115, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 116, "", 0, 0, 60001, 0, 4, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 117, "", 112101, 2, 60001, 0, 0, "スズメ", 3, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 118, "", 112101, 3, 60001, 7, 0, "スズメ", 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 119, "", 105801, 1, 80003, 1, 0, "ペコリーヌ", 0, "ヒューヒュー♪\nドンドンパフパフー♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 120, "", 105901, 1, 80003, 1, 0, "コッコロ", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 121, "", 105901, 2, 80003, 1, 0, "コッコロ", 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 122, "", 106001, 1, 80003, 1, 0, "キャル", 2, "え？　ちょっと\nいきなりなにっ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 123, "", 106001, 2, 80003, 1, 0, "キャル", 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 124, "", 105801, 2, 80003, 1, 0, "ペコリーヌ", 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 125, "", 105801, 3, 80003, 1, 0, "ペコリーヌ", 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 126, "", 105901, 3, 80003, 1, 0, "コッコロ", 1, "ですからその日に向けて\n今から気分を盛り上げているのです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 127, "", 106001, 3, 80003, 1, 0, "キャル", 2, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 128, "", 105901, 4, 80003, 1, 0, "コッコロ", 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 129, "", 105801, 4, 80003, 1, 0, "ペコリーヌ", 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 130, "", 106001, 4, 80003, 1, 0, "キャル", 2, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 131, "", 105901, 5, 80003, 1, 0, "コッコロ", 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 132, "", 106001, 5, 80003, 2, 0, "キャル", 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 133, "", 190801, 1, 80003, 2, 0, "カリン", 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 134, "", 106001, 6, 80003, 2, 0, "キャル", 0, "げっ…カリンじゃない\nなんでもないわよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 135, "", 190801, 2, 80003, 2, 0, "カリン", 1, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 136, "", 106001, 7, 80003, 2, 0, "キャル", 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 137, "", 190801, 3, 80003, 2, 0, "カリン", 1, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 138, "", 106001, 8, 80003, 2, 0, "キャル", 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 139, "", 106001, 9, 80003, 2, 0, "キャル", 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 140, "", 190801, 4, 80003, 2, 0, "カリン", 1, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 141, "", 106001, 10, 80003, 2, 0, "キャル", 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 142, "", 190801, 5, 80003, 2, 0, "カリン", 1, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 143, "", 106001, 11, 80003, 2, 0, "キャル", 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 144, "", 105901, 6, 80003, 3, 0, "コッコロ", 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 145, "", 105801, 5, 80003, 3, 0, "ペコリーヌ", 1, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 146, "", 105901, 7, 80003, 3, 0, "コッコロ", 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 147, "", 105901, 8, 80003, 3, 0, "コッコロ", 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 148, "", 105801, 6, 80003, 3, 0, "ペコリーヌ", 1, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 149, "", 105801, 7, 80003, 3, 0, "ペコリーヌ", 1, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 150, "", 105901, 9, 80003, 3, 0, "コッコロ", 0, "あとは、牧場に素敵な温泉が\n出来たとか…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 151, "", 105801, 8, 80003, 3, 0, "ペコリーヌ", 1, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 152, "", 105901, 10, 80003, 3, 0, "コッコロ", 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 153, "", 105801, 9, 80003, 3, 0, "ペコリーヌ", 1, "えへへ、ありがとうございます\nコッコロちゃん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 154, "", 105901, 11, 80003, 3, 0, "コッコロ", 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 155, "", 105801, 10, 80003, 3, 0, "ペコリーヌ", 1, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 156, "", 105801, 11, 80003, 4, 0, "ペコリーヌ", 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 157, "", 106001, 12, 80003, 4, 0, "キャル", 1, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 158, "", 105801, 12, 80003, 4, 0, "ペコリーヌ", 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 159, "", 106001, 13, 80003, 4, 0, "キャル", 1, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 160, "", 105801, 13, 80003, 4, 0, "ペコリーヌ", 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 161, "", 106001, 14, 80003, 4, 0, "キャル", 1, "…積極的？\nなんの話よ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 162, "", 105801, 14, 80003, 4, 0, "ペコリーヌ", 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 163, "", 105801, 15, 80003, 4, 0, "ペコリーヌ", 0, "ムーサの町で\nきゃるきゃる～ん☆　って！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 164, "", 106001, 15, 80003, 4, 0, "キャル", 1, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 165, "", 105801, 16, 80003, 4, 0, "ペコリーヌ", 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 166, "", 106001, 16, 80003, 4, 0, "キャル", 1, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 167, "", 106001, 17, 80003, 4, 0, "キャル", 1, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 168, "", 106001, 18, 80003, 5, 0, "キャル", 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 169, "", 105901, 12, 80003, 5, 0, "コッコロ", 1, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 170, "", 106001, 19, 80003, 5, 0, "キャル", 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 171, "", 105901, 13, 80003, 5, 0, "コッコロ", 1, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 172, "", 106001, 20, 80003, 5, 0, "キャル", 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 173, "", 105901, 14, 80003, 5, 0, "コッコロ", 1, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 174, "", 106001, 21, 80003, 5, 0, "キャル", 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 175, "", 105901, 15, 80003, 5, 0, "コッコロ", 1, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 176, "", 106001, 22, 80003, 5, 0, "キャル", 0, "かくし芸？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 177, "", 105901, 16, 80003, 5, 0, "コッコロ", 1, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 178, "", 106001, 23, 80003, 5, 0, "キャル", 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 179, "", 105801, 17, 80003, 6, 0, "ペコリーヌ", 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 180, "", 106001, 24, 80003, 6, 0, "キャル", 2, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 181, "", 105901, 17, 80003, 6, 0, "コッコロ", 1, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 182, "", 105801, 18, 80003, 6, 0, "ペコリーヌ", 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 183, "", 106001, 25, 80003, 6, 0, "キャル", 2, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 184, "", 105901, 18, 80003, 6, 0, "コッコロ", 1, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 185, "", 106001, 26, 80003, 6, 0, "キャル", 2, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 186, "", 106001, 27, 80003, 6, 0, "キャル", 2, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 187, "", 106001, 28, 80003, 6, 0, "キャル", 2, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 188, "", 105801, 19, 80003, 6, 0, "ペコリーヌ", 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 189, "", 105901, 19, 80003, 6, 0, "コッコロ", 1, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 190, "", 106001, 29, 80003, 6, 0, "キャル", 2, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 191, "", 106001, 30, 80003, 7, 0, "キャル", 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 192, "", 106001, 31, 80003, 7, 0, "キャル", 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 193, "", 106001, 32, 80003, 7, 0, "キャル", 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 194, "", 106001, 33, 80003, 7, 0, "キャル", 0, "あー\nあー\n…声、これで大丈夫かしら？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 195, "", 106001, 34, 80003, 7, 0, "キャル", 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 196, "", 106001, 35, 80003, 7, 0, "キャル", 0, "オイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 197, "", 106001, 36, 80003, 7, 0, "キャル", 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 198, "", 106001, 37, 80003, 7, 0, "キャル", 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 199, "", 106001, 38, 80003, 7, 0, "キャル", 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 200, "", 105901, 20, 80003, 8, 0, "コッコロ", 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 201, "", 105901, 21, 80003, 8, 0, "コッコロ", 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 202, "", 105901, 22, 80003, 8, 0, "コッコロ", 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 203, "", 105901, 23, 80003, 8, 0, "コッコロ", 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 204, "", 105901, 24, 80003, 8, 0, "コッコロ", 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 205, "", 105901, 25, 80003, 8, 0, "コッコロ", 0, "オイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 206, "", 105901, 26, 80003, 8, 0, "コッコロ", 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 207, "", 105901, 27, 80003, 8, 0, "コッコロ", 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 208, "", 105901, 28, 80003, 8, 0, "コッコロ", 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 209, "", 105801, 20, 80003, 9, 0, "ペコリーヌ", 0, "オイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 210, "", 105801, 21, 80003, 9, 0, "ペコリーヌ", 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 211, "", 105801, 22, 80003, 9, 0, "ペコリーヌ", 0, "あと６日で2.5周年ですか…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 212, "", 105801, 23, 80003, 9, 0, "ペコリーヌ", 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 213, "", 105801, 24, 80003, 9, 0, "ペコリーヌ", 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 214, "", 105801, 25, 80003, 9, 0, "ペコリーヌ", 0, "オイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 215, "", 105801, 26, 80003, 9, 0, "ペコリーヌ", 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 216, "", 105801, 27, 80003, 9, 0, "ペコリーヌ", 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 217, "", 105801, 28, 80003, 9, 0, "ペコリーヌ", 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 218, "", 105801, 29, 80003, 9, 0, "ペコリーヌ", 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 219, "", 105801, 30, 80003, 9, 0, "ペコリーヌ", 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 220, "", 105801, 31, 80003, 10, 0, "ペコリーヌ", 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 221, "", 105901, 29, 80003, 10, 0, "コッコロ", 1, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 222, "", 105801, 32, 80003, 10, 0, "ペコリーヌ", 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 223, "", 106001, 39, 80003, 10, 0, "キャル", 2, "…………");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 224, "", 105901, 30, 80003, 10, 0, "コッコロ", 1, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 225, "", 106001, 40, 80003, 10, 0, "キャル", 2, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 226, "", 105801, 33, 80003, 10, 0, "ペコリーヌ", 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 227, "", 106001, 41, 80003, 10, 0, "キャル", 2, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 228, "", 105801, 34, 80003, 10, 0, "ペコリーヌ", 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 229, "", 105801, 35, 80003, 10, 0, "ペコリーヌ", 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 230, "", 106001, 42, 80003, 10, 0, "キャル", 2, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 231, "", 105901, 31, 80003, 10, 0, "コッコロ", 1, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 232, "", 106001, 43, 80003, 10, 0, "キャル", 2, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 233, "", 105801, 36, 80003, 10, 0, "ペコリーヌ", 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 234, "", 190801, 6, 80003, 11, 0, "カリン", 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 235, "", 190801, 7, 80003, 11, 0, "カリン", 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 236, "", 190801, 8, 80003, 11, 0, "カリン", 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 237, "", 190801, 9, 80003, 11, 0, "カリン", 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 238, "", 190801, 10, 80003, 11, 0, "カリン", 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 239, "", 190801, 11, 80003, 11, 0, "カリン", 0, "次にコッコロさんですが\nこちらは発声練習をしています");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 240, "", 190801, 12, 80003, 11, 0, "カリン", 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 241, "", 190801, 13, 80003, 11, 0, "カリン", 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 242, "", 190801, 14, 80003, 11, 0, "カリン", 0, "あれ？\nもしかして緊張で気を失って…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 243, "", 190801, 15, 80003, 11, 0, "カリン", 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 244, "", 190801, 16, 80003, 11, 0, "カリン", 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 245, "", 190801, 17, 80003, 11, 0, "カリン", 0, "それでは\nまた明日お会いしましょう♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 246, "", 106001, 44, 80003, 12, 0, "キャル", 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 247, "", 105801, 37, 80003, 12, 0, "ペコリーヌ", 2, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 248, "", 105901, 32, 80003, 12, 0, "コッコロ", 1, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 249, "", 106001, 45, 80003, 12, 0, "キャル", 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 250, "", 105801, 38, 80003, 12, 0, "ペコリーヌ", 2, "ひどいですよぉキャルちゃ～ん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 251, "", 105901, 33, 80003, 12, 0, "コッコロ", 1, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 252, "", 105801, 39, 80003, 12, 0, "ペコリーヌ", 2, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 253, "", 106001, 46, 80003, 12, 0, "キャル", 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 254, "", 105901, 34, 80003, 12, 0, "コッコロ", 1, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 255, "", 105801, 40, 80003, 12, 0, "ペコリーヌ", 2, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 256, "", 105801, 41, 80003, 13, 0, "ペコリーヌ", 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 257, "", 106001, 47, 80003, 13, 0, "キャル", 2, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 258, "", 105801, 42, 80003, 13, 0, "ペコリーヌ", 0, "忘れてきちゃいました☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 259, "", 106001, 48, 80003, 13, 0, "キャル", 2, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 260, "", 105901, 35, 80003, 13, 0, "コッコロ", 1, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 261, "", 106001, 49, 80003, 13, 0, "キャル", 2, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 262, "", 105801, 43, 80003, 13, 0, "ペコリーヌ", 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 263, "", 106001, 50, 80003, 13, 0, "キャル", 2, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 264, "", 105901, 36, 80003, 13, 0, "コッコロ", 1, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 265, "", 106001, 51, 80003, 13, 0, "キャル", 2, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 266, "", 105901, 37, 80003, 13, 0, "コッコロ", 1, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 267, "", 106001, 52, 80003, 13, 0, "キャル", 2, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 268, "", 105801, 44, 80003, 13, 0, "ペコリーヌ", 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 269, "", 105901, 38, 80003, 13, 0, "コッコロ", 1, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 270, "", 105801, 45, 80003, 13, 0, "ペコリーヌ", 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 271, "", 106001, 53, 80003, 13, 0, "キャル", 2, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 272, "", 105801, 46, 80003, 13, 0, "ペコリーヌ", 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 273, "", 190801, 18, 80003, 14, 0, "カリン", 0, "こんにちは\n【ギルド管理協会】のカリンです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 274, "", 190801, 19, 80003, 14, 0, "カリン", 0, "昨日の生放送は\nいかがだったでしょうか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 275, "", 190801, 20, 80003, 14, 0, "カリン", 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 276, "", 190801, 21, 80003, 14, 0, "カリン", 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 277, "", 190801, 22, 80003, 14, 0, "カリン", 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 278, "", 190801, 23, 80003, 14, 0, "カリン", 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 279, "", 190801, 24, 80003, 14, 0, "カリン", 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 280, "", 190801, 25, 80003, 14, 0, "カリン", 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 281, "", 190801, 26, 80003, 14, 0, "カリン", 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 282, "", 190801, 27, 80003, 14, 0, "カリン", 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 283, "", 105801, 47, 80003, 15, 0, "ペコリーヌ", 0, "準備はいいですかっ？\n…いっきますよー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 284, "", 106001, 54, 80003, 15, 0, "キャル", 2, "祝！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 285, "", 105901, 39, 80003, 15, 0, "コッコロ", 1, "2.5周年！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 286, "", 105801, 48, 80003, 15, 0, "ペコリーヌ", 0, "おめでとうございま～す☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 287, "", 106001, 55, 80003, 15, 0, "キャル", 2, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 288, "", 105901, 40, 80003, 15, 0, "コッコロ", 1, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 289, "", 105801, 49, 80003, 15, 0, "ペコリーヌ", 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 290, "", 106001, 56, 80003, 15, 0, "キャル", 2, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 291, "", 105901, 41, 80003, 15, 0, "コッコロ", 1, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 292, "", 106001, 57, 80003, 15, 0, "キャル", 2, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 293, "", 105801, 50, 80003, 15, 0, "ペコリーヌ", 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 294, "", 106001, 58, 80003, 15, 0, "キャル", 2, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 295, "", 105801, 51, 80003, 15, 0, "ペコリーヌ", 0, "記念日だから\n平気平気♪\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 296, "", 106001, 59, 80003, 15, 0, "キャル", 2, "意味分かんないわよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 297, "", 105901, 42, 80003, 15, 0, "コッコロ", 1, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 298, "", 105901, 43, 80003, 15, 0, "コッコロ", 1, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 299, "", 105801, 52, 80003, 15, 0, "ペコリーヌ", 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 300, "", 106001, 60, 80003, 15, 0, "キャル", 2, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 301, "", 105901, 44, 80003, 15, 0, "コッコロ", 1, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 302, "", 105801, 53, 80003, 15, 0, "ペコリーヌ", 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 0, 303, "105901,45,106001,61", 105801, 54, 80003, 15, 0, "ペコリーヌ・コッコロ・キャル", 0, "2.5周年\nありがとうございます！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 304, "", 190804, 1, 60002, 0, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 305, "", 0, 0, 60002, 0, 1, "", 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 306, "", 0, 0, 60002, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 307, "", 0, 0, 60002, 0, 1, "", 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 308, "", 0, 0, 60002, 0, 1, "", 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 309, "", 0, 0, 60002, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 310, "", 0, 0, 60002, 0, 2, "", 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 311, "", 0, 0, 60002, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 312, "", 0, 0, 60002, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 313, "", 0, 0, 60002, 0, 2, "", 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 314, "", 0, 0, 60002, 0, 2, "", 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 315, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 316, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 317, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 318, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 319, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 320, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 321, "", 0, 0, 60002, 0, 3, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 322, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 323, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 324, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 325, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 326, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 327, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 328, "", 0, 0, 60002, 0, 4, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 329, "", 190804, 2, 60002, 0, 0, "カリン", 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 330, "", 190804, 3, 60002, 7, 0, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 331, "", 105901, 1, 80005, 1, 0, "コッコロ", 4, "ささ、シェフィさまはこちらへ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 332, "", 106401, 1, 80005, 1, 0, "シェフィ", 0, "コッコロさん、どこへ行くの…？\n…え？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 333, "", 105801, 1, 80005, 1, 0, "ペコリーヌ", 3, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 334, "", 105901, 2, 80005, 1, 0, "コッコロ", 4, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 335, "", 106401, 2, 80005, 1, 0, "シェフィ", 0, "ええと…\n二人とも何をしているの？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 336, "", 106001, 1, 80005, 1, 0, "キャル", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 337, "", 106401, 3, 80005, 1, 0, "シェフィ", 0, "あの日…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 338, "", 105801, 2, 80005, 1, 0, "ペコリーヌ", 3, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 339, "", 105801, 3, 80005, 1, 0, "ペコリーヌ", 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 340, "", 190801, 1, 80005, 1, 0, "カリン", 2, "やばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 341, "", 106001, 2, 80005, 1, 0, "キャル", 1, "って、なにしれっと\n参加してんのよカリン！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 342, "", 190801, 2, 80005, 1, 0, "カリン", 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 343, "", 190801, 3, 80005, 1, 0, "カリン", 2, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 344, "", 105801, 4, 80005, 1, 0, "ペコリーヌ", 3, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 345, "", 106401, 4, 80005, 1, 0, "シェフィ", 0, "えっ！？　ええとええと…！\nあ、あと14日…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 346, "", 105801, 5, 80005, 2, 0, "ペコリーヌ", 3, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 347, "", 105901, 3, 80005, 2, 0, "コッコロ", 1, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 348, "", 105901, 4, 80005, 2, 0, "コッコロ", 1, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 349, "", 105801, 6, 80005, 2, 0, "ペコリーヌ", 3, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 350, "", 105901, 5, 80005, 2, 0, "コッコロ", 1, "さすがでございます\nペコリーヌさま");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 351, "", 106001, 3, 80005, 2, 0, "キャル", 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 352, "", 106401, 5, 80005, 2, 0, "シェフィ", 2, "しゃなり、しゃなり…\nふふ、案外できるものね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 353, "", 105801, 7, 80005, 2, 0, "ペコリーヌ", 3, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 354, "", 105901, 6, 80005, 2, 0, "コッコロ", 1, "さ、次はキャルさまの\n番でございますよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 355, "", 106001, 4, 80005, 2, 0, "キャル", 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 356, "", 106401, 6, 80005, 2, 0, "シェフィ", 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 357, "", 106001, 5, 80005, 2, 0, "キャル", 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 358, "", 106001, 6, 80005, 2, 0, "キャル", 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 359, "", 105901, 7, 80005, 2, 0, "コッコロ", 1, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 360, "", 106001, 7, 80005, 2, 0, "キャル", 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 361, "", 105901, 8, 80005, 3, 0, "コッコロ", 1, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 362, "", 105801, 8, 80005, 3, 0, "ペコリーヌ", 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 363, "", 105901, 9, 80005, 3, 0, "コッコロ", 1, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 364, "", 106401, 7, 80005, 3, 0, "シェフィ", 2, "聖学祭…って、なにかしら？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 365, "", 105901, 10, 80005, 3, 0, "コッコロ", 1, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 366, "", 106001, 8, 80005, 3, 0, "キャル", 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 367, "", 106001, 9, 80005, 3, 0, "キャル", 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 368, "", 105801, 9, 80005, 3, 0, "ペコリーヌ", 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 369, "", 106001, 10, 80005, 3, 0, "キャル", 0, "いや、そのまんますぎでしょ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 370, "", 106401, 8, 80005, 3, 0, "シェフィ", 2, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 371, "", 105801, 10, 80005, 3, 0, "ペコリーヌ", 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 372, "", 106401, 9, 80005, 3, 0, "シェフィ", 2, "えっ？　ええ…\nぎゅーっ…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 373, "", 106001, 11, 80005, 4, 0, "キャル", 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 374, "", 106401, 10, 80005, 4, 0, "シェフィ", 2, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 375, "", 106001, 12, 80005, 4, 0, "キャル", 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 376, "", 105901, 11, 80005, 4, 0, "コッコロ", 1, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 377, "", 106001, 13, 80005, 4, 0, "キャル", 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 378, "", 105801, 11, 80005, 4, 0, "ペコリーヌ", 3, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 379, "", 106001, 14, 80005, 4, 0, "キャル", 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 380, "", 106001, 15, 80005, 4, 0, "キャル", 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 381, "", 106401, 11, 80005, 4, 0, "シェフィ", 2, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 382, "", 105801, 12, 80005, 4, 0, "ペコリーヌ", 3, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 383, "", 105901, 12, 80005, 4, 0, "コッコロ", 1, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 384, "", 106001, 16, 80005, 4, 0, "キャル", 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 385, "", 106401, 12, 80005, 4, 0, "シェフィ", 2, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 386, "", 105801, 13, 80005, 5, 0, "ペコリーヌ", 3, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 387, "", 105801, 14, 80005, 5, 0, "ペコリーヌ", 3, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 388, "", 105801, 15, 80005, 5, 0, "ペコリーヌ", 3, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 389, "", 106001, 17, 80005, 5, 0, "キャル", 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 390, "", 106001, 18, 80005, 5, 0, "キャル", 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 391, "", 106401, 13, 80005, 5, 0, "シェフィ", 2, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 392, "", 105901, 13, 80005, 5, 0, "コッコロ", 1, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 393, "", 105801, 16, 80005, 5, 0, "ペコリーヌ", 3, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 394, "", 106001, 19, 80005, 5, 0, "キャル", 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 395, "", 105801, 17, 80005, 5, 0, "ペコリーヌ", 3, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 396, "", 105801, 18, 80005, 5, 0, "ペコリーヌ", 3, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 397, "", 105801, 19, 80005, 5, 0, "ペコリーヌ", 3, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 398, "", 190801, 4, 80005, 6, 0, "カリン", 2, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 399, "", 190801, 5, 80005, 6, 0, "カリン", 2, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 400, "", 106001, 20, 80005, 6, 0, "キャル", 1, "…えっ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 401, "", 105801, 20, 80005, 6, 0, "ペコリーヌ", 3, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 402, "", 106401, 14, 80005, 6, 0, "シェフィ", 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 403, "", 105901, 14, 80005, 6, 0, "コッコロ", 4, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 404, "", 106401, 15, 80005, 6, 0, "シェフィ", 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 405, "", 106001, 21, 80005, 6, 0, "キャル", 1, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 406, "", 105801, 21, 80005, 6, 0, "ペコリーヌ", 3, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 407, "", 106001, 22, 80005, 6, 0, "キャル", 1, "ぶっ殺すぞ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 408, "", 190801, 6, 80005, 6, 0, "カリン", 2, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 409, "", 105901, 15, 80005, 7, 0, "コッコロ", 1, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 410, "", 106001, 23, 80005, 7, 0, "キャル", 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 411, "", 106401, 16, 80005, 7, 0, "シェフィ", 2, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 412, "", 105801, 22, 80005, 7, 0, "ペコリーヌ", 3, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 413, "", 106001, 24, 80005, 7, 0, "キャル", 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 414, "", 106401, 17, 80005, 7, 0, "シェフィ", 2, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 415, "", 105901, 16, 80005, 7, 0, "コッコロ", 1, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 416, "", 106401, 18, 80005, 7, 0, "シェフィ", 2, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 417, "", 105901, 17, 80005, 7, 0, "コッコロ", 1, "もちろんでございます\n仲良くお勉強いたしましょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 418, "", 106001, 25, 80005, 7, 0, "キャル", 0, "しれっと教育ママが\n生まれてる…？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 419, "", 105801, 23, 80005, 7, 0, "ペコリーヌ", 3, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 420, "", 106001, 26, 80005, 7, 0, "キャル", 0, "え～～～～！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 421, "", 106001, 27, 80005, 8, 0, "キャル", 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 422, "", 106401, 19, 80005, 8, 0, "シェフィ", 2, "…\nねぇコッコロさん\nキャル、どうしちゃったの？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 423, "", 105901, 18, 80005, 8, 0, "コッコロ", 1, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 424, "", 105801, 24, 80005, 8, 0, "ペコリーヌ", 3, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 425, "", 106401, 20, 80005, 8, 0, "シェフィ", 2, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 426, "", 106001, 28, 80005, 8, 0, "キャル", 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 427, "", 105901, 19, 80005, 8, 0, "コッコロ", 1, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 428, "", 106401, 21, 80005, 8, 0, "シェフィ", 2, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 429, "", 106001, 29, 80005, 8, 0, "キャル", 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 430, "", 106001, 30, 80005, 8, 0, "キャル", 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 431, "", 105801, 25, 80005, 8, 0, "ペコリーヌ", 3, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 432, "", 106001, 31, 80005, 8, 0, "キャル", 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 433, "", 106401, 22, 80005, 9, 0, "シェフィ", 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 434, "", 106401, 23, 80005, 9, 0, "シェフィ", 0, "…えっ？\n生放送の意気込み！？\n突然なに！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 435, "", 106401, 24, 80005, 9, 0, "シェフィ", 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 436, "", 106401, 25, 80005, 9, 0, "シェフィ", 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 437, "", 106401, 26, 80005, 9, 0, "シェフィ", 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 438, "", 106401, 27, 80005, 9, 0, "シェフィ", 0, "それから、それから…！\nぅ、ぅぅっ…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 439, "", 106401, 28, 80005, 9, 0, "シェフィ", 0, "―びえぇぇ～んっ！！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 440, "", 105901, 20, 80005, 9, 0, "コッコロ", 1, "どうされましたか、シェフィさま");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 441, "", 106401, 29, 80005, 9, 0, "シェフィ", 0, "ううっ…ひっく…\nママッ…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 442, "", 105901, 21, 80005, 9, 0, "コッコロ", 1, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 443, "", 105901, 22, 80005, 9, 0, "コッコロ", 1, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 444, "", 106401, 30, 80005, 9, 0, "シェフィ", 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 445, "", 105901, 23, 80005, 10, 0, "コッコロ", 0, "主さま\n3.5周年まであと５日\nでございます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 446, "", 105901, 24, 80005, 10, 0, "コッコロ", 0, "ですがその前に\n生放送がありますね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 447, "", 105901, 25, 80005, 10, 0, "コッコロ", 0, "…生放送に向けた\n意気込みでございますか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 448, "", 105901, 26, 80005, 10, 0, "コッコロ", 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 449, "", 105901, 27, 80005, 10, 0, "コッコロ", 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 450, "", 105901, 28, 80005, 10, 0, "コッコロ", 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 451, "", 105901, 29, 80005, 10, 0, "コッコロ", 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 452, "", 105901, 30, 80005, 10, 0, "コッコロ", 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 453, "", 105901, 31, 80005, 10, 0, "コッコロ", 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 454, "", 105801, 26, 80005, 11, 0, "ペコリーヌ", 0, "3.5周年まであと４日！\nやばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 455, "", 106001, 32, 80005, 11, 0, "キャル", 1, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 456, "", 105801, 27, 80005, 11, 0, "ペコリーヌ", 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 457, "", 105801, 28, 80005, 11, 0, "ペコリーヌ", 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 458, "", 105801, 29, 80005, 11, 0, "ペコリーヌ", 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 459, "", 106001, 33, 80005, 11, 0, "キャル", 1, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 460, "", 105801, 30, 80005, 11, 0, "ペコリーヌ", 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 461, "", 105801, 31, 80005, 11, 0, "ペコリーヌ", 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 462, "", 105801, 32, 80005, 11, 0, "ペコリーヌ", 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 463, "", 106001, 34, 80005, 11, 0, "キャル", 1, "だからあたしはやるなんて一言も…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 464, "", 105801, 33, 80005, 11, 0, "ペコリーヌ", 0, "オイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 465, "", 106001, 35, 80005, 11, 0, "キャル", 1, "聞きなさいっての！！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 466, "", 106401, 31, 80005, 12, 0, "シェフィ", 2, "3.5周年まであと３日…\nそして生放送は、明日…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 467, "", 106401, 32, 80005, 12, 0, "シェフィ", 2, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 468, "", 106401, 33, 80005, 12, 0, "シェフィ", 2, "おいっす！\n…こうじゃなかったわね\nええと確か…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 469, "", 106401, 34, 80005, 12, 0, "シェフィ", 2, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 470, "", 106401, 35, 80005, 12, 0, "シェフィ", 2, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 471, "", 105801, 34, 80005, 12, 0, "ペコリーヌ", 3, "やってますねシェフィちゃん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 472, "", 106001, 36, 80005, 12, 0, "キャル", 0, "なによ、考えることは\nみんな同じってこと？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 473, "", 105901, 32, 80005, 12, 0, "コッコロ", 1, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 474, "", 106401, 36, 80005, 12, 0, "シェフィ", 2, "みんな…もちろんよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 475, "", 105801, 35, 80005, 12, 0, "ペコリーヌ", 3, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 476, "", 190801, 7, 80005, 13, 0, "カリン", 2, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 477, "", 190801, 8, 80005, 13, 0, "カリン", 2, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 478, "", 105801, 36, 80005, 13, 0, "ペコリーヌ", 3, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 479, "", 190801, 9, 80005, 13, 0, "カリン", 2, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 480, "", 105901, 33, 80005, 13, 0, "コッコロ", 4, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 481, "", 190801, 10, 80005, 13, 0, "カリン", 2, "さすが【美食殿】のママですね！\nそしてキャルさんは…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 482, "", 106001, 37, 80005, 13, 0, "キャル", 1, "大丈夫…大丈夫…\nあたしは大丈夫…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 483, "", 190801, 11, 80005, 13, 0, "カリン", 2, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 484, "", 106401, 37, 80005, 13, 0, "シェフィ", 0, "あうー？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 0, 485, "105901,34,106001,38,190801,12", 105801, 37, 80005, 13, 0, "みんな", 4, "あ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 486, "", 106001, 39, 80005, 13, 0, "キャル", 1, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 487, "", 105901, 35, 80005, 13, 0, "コッコロ", 4, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 488, "", 105801, 38, 80005, 13, 0, "ペコリーヌ", 3, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 489, "", 190801, 13, 80005, 13, 0, "カリン", 2, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 490, "", 106401, 38, 80005, 14, 0, "シェフィ", 2, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 491, "", 105801, 39, 80005, 14, 0, "ペコリーヌ", 3, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 492, "", 106001, 40, 80005, 14, 0, "キャル", 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 493, "", 105901, 36, 80005, 14, 0, "コッコロ", 1, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 494, "", 106401, 39, 80005, 14, 0, "シェフィ", 2, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 495, "", 105801, 40, 80005, 14, 0, "ペコリーヌ", 3, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 496, "", 105901, 37, 80005, 14, 0, "コッコロ", 1, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 497, "", 106001, 41, 80005, 14, 0, "キャル", 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 498, "", 106401, 40, 80005, 14, 0, "シェフィ", 2, "へ、へぇ…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 499, "", 105801, 41, 80005, 14, 0, "ペコリーヌ", 3, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 500, "", 106401, 41, 80005, 14, 0, "シェフィ", 2, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 501, "", 106401, 42, 80005, 14, 0, "シェフィ", 2, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 502, "", 105801, 42, 80005, 15, 0, "ペコリーヌ", 3, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 503, "", 106001, 42, 80005, 15, 0, "キャル", 1, "祝！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 504, "", 105901, 38, 80005, 15, 0, "コッコロ", 4, "3.5周年！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 505, "", 106401, 43, 80005, 15, 0, "シェフィ", 0, "おめでとうございます！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 506, "", 190801, 14, 80005, 15, 0, "カリン", 2, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 507, "", 190801, 15, 80005, 15, 0, "カリン", 2, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 508, "", 105801, 43, 80005, 15, 0, "ペコリーヌ", 3, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 509, "", 105801, 44, 80005, 15, 0, "ペコリーヌ", 3, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 510, "", 106001, 43, 80005, 15, 0, "キャル", 1, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 511, "", 106001, 44, 80005, 15, 0, "キャル", 1, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 512, "", 106401, 44, 80005, 15, 0, "シェフィ", 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 513, "", 106401, 45, 80005, 15, 0, "シェフィ", 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 514, "", 105901, 39, 80005, 15, 0, "コッコロ", 4, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 515, "", 105901, 40, 80005, 15, 0, "コッコロ", 4, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 516, "", 105901, 41, 80005, 15, 0, "コッコロ", 4, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 517, "", 105801, 45, 80005, 15, 0, "ペコリーヌ", 3, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 0, 518, "105901,42,106001,45,106401,46,190801,16", 105801, 46, 80005, 15, 0, "みんな", 4, "これからも\nよろしくおねがいします！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 519, "", 190804, 1, 60003, 0, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 520, "", 0, 0, 60003, 0, 1, "", 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 521, "", 0, 0, 60003, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 522, "", 0, 0, 60003, 0, 1, "", 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 523, "", 0, 0, 60003, 0, 1, "", 2, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 524, "", 0, 0, 60003, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 525, "", 0, 0, 60003, 0, 2, "", 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 526, "", 0, 0, 60003, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 527, "", 0, 0, 60003, 0, 2, "", 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 528, "", 0, 0, 60003, 0, 2, "", 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 529, "", 0, 0, 60003, 0, 2, "", 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 530, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 531, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 532, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 533, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 534, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 535, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 536, "", 0, 0, 60003, 0, 3, "", 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 537, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 538, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 539, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 540, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 541, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 542, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 2, 543, "", 0, 0, 60003, 0, 4, "", 2, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 544, "", 190804, 2, 60003, 0, 0, "カリン", 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 0, 545, "", 190804, 3, 60003, 7, 0, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 546, "", 190804, 1, 60004, 0, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 547, "", 0, 0, 60004, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 548, "", 0, 0, 60004, 0, 1, "", 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 549, "", 0, 0, 60004, 0, 1, "", 2, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 550, "", 0, 0, 60004, 0, 1, "", 2, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, 1, 551, "", 0, 0, 60004, 0, 1, "", 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪");
